import React from "react";

const ListaUsuarios = ({ usuarios, handleUserClick }) => {
  return (
    <div>
      <h3>Lista de Usuarios</h3>
      <ul>
        {usuarios.map((usuario) => (
          <li key={usuario} onClick={() => handleUserClick(usuario)}>
            {usuario}
          </li>
        ))}
      </ul>
    </div>
  );
};

export default ListaUsuarios;
